export default function Content(props) {
  let num = 0;
  props.parts.forEach((obj) => num += obj.exercises);
  return (
    <header>
      <ul>
      {props.parts.map((obj, i) => (
        <li key={i}>{obj.name} {obj.exercises}</li>
      ))}
      </ul>
      <h2>Total of {id} exercises</h2>
    </header>
  );
}
